const Timebar = () => {
  let currentDate = new Date();
  let newDate;
  let week = [];
  for (var i = 1; i <= 7; i++) {
    newDate = new Date(
      currentDate.getFullYear(),
      currentDate.getMonth(),
      currentDate.getDate() + i
    );
    week.push(newDate.toDateString());
  }
  return (
    <div>
      {week.map((day) => {
        return (
          <div>
            <h6>{day}</h6>
          </div>
        );
      })}
    </div>
  );
};

export default Timebar;
